// src/pages/History.js
import React from 'react';

const History = () => {
  return (
    <div className="container mx-auto mt-5">
      <h1 className="text-3xl font-bold mb-4">Location History</h1>
      {/* Add logic to fetch and display user's location history here */}
      <p>Your location history will be displayed here.</p>
    </div>
  );
};

export default History;
